  false,\n\t\"url\": null,\n\t\"notes\": \"Research support for various organizations
  in NOAA (Northwest Regional Office (NWR), HQ Office of Protected Resources, National
  Ocean Service (NOS) Coastal Services Center) for copper related to the harmful impacts
  of urban stormwater runoff, pesticide use, antifoulant use, and mining (e.g., proposed
  hardrock mining in Alaska). This has been a core focus of Ecotoxicology research
  for years, and may redirect to address key and high-profile data gaps specific to
  salmon habitat threats in Alaska.nnBehavioral observations and video of salmonids
  responding to odors and predators.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
